import datetime

# This is a trivial implementation. A real-world one would probably use some distributed in-memory cache
# that holds, say, 3650 days * 10k tickers = 36m elements
class PortfolioTestEodPriceProvider:
  def get_price(d,ticker):
    if ticker not in PortfolioTestEodPriceProvider.eod_prices:
      raise RuntimeError(f"prices for {ticker} are not available")
    items = PortfolioTestEodPriceProvider.eod_prices[ticker]
    l = 0
    r = len(items)-1
    while r-l > 1:
      if d < items[l]["d"] or items[r]["d"] < d:
        raise RuntimeError(f'{ticker} price for {d} is beyond available range {items[l]["d"]} - {items[r]["d"]}')
      m = round((r+l)/2)
      if d < items[m]["d"]:
        r = m
      elif items[m]["d"] < d:
        l = m
      else:
        return items[m]["p"]
      
    # Here we have items[l]["d"] < d < items[r]["d"]. Interpolate.
    ld = datetime.date.fromisoformat(items[l]["d"])
    rd = datetime.date.fromisoformat(items[r]["d"])

    diff_total = (rd-ld).days # It's 2 or larger
    diff_left = (datetime.date.fromisoformat(d)-ld).days
    return round(items[l]["p"] + diff_left/diff_total*(items[r]["p"]-items[l]["p"]),2)

    return PortfolioTestEodPriceProvider.eod_prices[d][ticker]

